    "body": "These are no longer supported in React 18. They are replaced by the `createRoot` API.\r\n\r\nThe warning includes a link to documentation of the new API. Currently it redirects to the corresponding working group post:\r\n\r\nhttps://reactjs.org/link/switch-to-createroot\r\n\r\nMany of our tests still use ReactDOM.render. We will need to gradually migrate them over to createRoot.\r\n\r\nIn the meantime, I added the warnings to our internal warning filter.",
