    "title": "Prepare semver (`@latest`) releases in CI",
    "user": {
      "login": "acdlite",
      "id": 3624098,
      "node_id": "MDQ6VXNlcjM2MjQwOTg=",
      "avatar_url": "https://avatars.githubusercontent.com/u/3624098?v=4",
      "gravatar_id": "",
      "url": "https://api.github.com/users/acdlite",
      "html_url": "https://github.com/acdlite",
      "followers_url": "https://api.github.com/users/acdlite/followers",
      "following_url": "https://api.github.com/users/acdlite/following{/other_user}",
      "gists_url": "https://api.github.com/users/acdlite/gists{/gist_id}",
      "starred_url": "https://api.github.com/users/acdlite/starred{/owner}{/repo}",
      "subscriptions_url": "https://api.github.com/users/acdlite/subscriptions",
      "organizations_url": "https://api.github.com/users/acdlite/orgs",
      "repos_url": "https://api.github.com/users/acdlite/repos",
      "events_url": "https://api.github.com/users/acdlite/events{/privacy}",
      "received_events_url": "https://api.github.com/users/acdlite/received_events",
      "type": "User",
      "site_admin": false
    },
    "body": "Now that we track package versions in source, `@latest` builds should be fully reproducible for a given commit. We can prepare the packages in CI and store them as artifacts, the same way we do for `@next` and `@experimental`.\r\n\r\nEventually this can replace the interactive script that we currently use to swap out the version numbers.\r\n\r\nThe other nice thing about this approach is that we can run tests in CI to verify that the packages are releasable, instead of waiting until right before publish.\r\n\r\nI named the output directory `oss-stable-semver`, to distinguish from the `@next` prereleases that are located at `oss-stable`. I don't love this naming. I'd prefer to use the name of the corresponding npm dist tag. I'll do that in a follow-up, though, since the `oss-stable` name is referenced in a handful of places.\r\n\r\nCurrent naming (after this PR):\r\n\r\n- `oss-experimental`  `@experimental`\r\n- `oss-stable`  `@next`\r\n- `oss-stable-semver`  `@latest`\r\n\r\nProposed naming (not yet implemented, requires more work):\r\n\r\n- `oss-experimental`  `@experimental`\r\n- `oss-next`  `@next`\r\n- `oss-latest`  `@latest`",
