    "body": "All entry points now export createRoot. However, not all entry points export ReactDOM.render (www-modern). We really should be running most tests against createRoot anyway since that's the main entry point going forward.\r\n\r\nTo be able to run existing tests against www-modern, we need to convert all tests to createRoot (unless they're explicitly testing legacy behavior).\r\n\r\nI start with the ES6/TypeScript/CoffeeScript equivalency tests.",
